+    font-size: 24px;
+    position: absolute;
+    right: 30px;
+    line-height: 20px;
+    transition: 0.2s;
+    -webkit-transition: 0.2s;
+    -ms-transition: 0.2s;
+}
+
+.accordion .pagenav.open h4 i {
+    transform: rotate(90deg);
+}
+
+.accordion a:hover,
+.accordion .pagenav li.current_page_item a {
+    text-decoration: underline;
+}
